import React, { useEffect, useState } from 'react'
import './css/Inventory.css'

export default function Inventory() {

    const [cars, setCars] = useState(null);
    const [parts, setParts] = useState(null);
    const [option, setOption] = useState("cars")

    if(option === "cars") {
        return (
            <div>
                <button>Cars</button>
                <button>Parts</button>
                <button>Misc</button>
                <p>You chose car</p>
            </div>
        )
    }

    if(option === "parts") {
        return (
            <div>
                <button>Cars</button>
                <button>Parts</button>
                <button>Misc</button>
                <p>You chose car</p>
            </div>
        )
    }

    if(option === "misc") {
        return (
            <div>
                <button>Cars</button>
                <button>Parts</button>
                <button>Misc</button>
                <p>You chose car</p>
            </div>
        )
    }


    return(
        <div>
            <h2 class="inventoryHeader">Inventory</h2>
        </div>

    )
}
